import React from "react";
import Nav from '../../homePage/components/nav.js'
import Footer from '../../homePage/components/footer.js'
import Recipes from '../components/Recipes.js'
function RecipeList () {
    return (
        <div>
            <Nav/>
            <Recipes/>
            <Footer/>
        </div>
    )
};
export default RecipeList ;
